import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

let Contents = styled.div`
  // background: #00457e;
  background: black;
  margin: 2rem;
  border-radius: 1rem;
  padding: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  color: white;
`;
let Idwrap = styled.div`
  padding: 0.5rem;
`;

let LCwrap = styled.div`
  padding: 0.5rem;
`;

let HashTag = styled.div`
  padding: 0.5rem;
`;

function Feeds() {
  return (
    <Contents>
      <Idwrap>Username</Idwrap>
      <LCwrap>좋아요/댓글</LCwrap>
      <div
        style={{
          background: "grey",
          width: "30rem",
          height: "30rem",
          margin: "0.5rem",
        }}></div>
      제목 : 블랙핑크 노래 좋습니다.<HashTag>#블랙핑크</HashTag>
      블랙핑크 노래가 아주 좋습니다.
    </Contents>
  );
}
export default Feeds;
